function script(){
    let input = document.querySelector('input-third');
document.querySelector('#button1').onclick = function() {
  if (document.querySelector('input-third').value.length == 0) {
    alert("Please Enter Your Task");
  } else {
    const taskName = document.querySelector('input-third').value;
    localStorage.setItem("taskName", taskName);
    window.location.href = "/second";
  }
}

}
